import React, { Component } from 'react';



class Header extends Component {
  render() {
    return (
      <header className="header">

      <div className="logo">
      Logo
      </div>

      <nav>
      <ul>
        <li>
        <a href="#">Home</a>
        </li>

        <li>
        <a href="#">Contacts</a>
        </li>
      </ul>
      </nav>


      </header>
    );
  }
}

export default Header;
